import React from "react";
import picture from "../images/me 1.jpeg";

export default function Start() {
  return (
    <div className="h-screen bg-black">
      <div>
        <h2 className="text-4xl">Syed Wajahat Ali</h2>
        <img className="w-96" src={picture} alt="img" />
      </div>
    </div>
  );
}
